Many know, but my Dad had a successful swimming career. I ended up following his lead and constantly draw inspiration from the similarities in our journeys. We both have competed in 2 Pan Am Games. However, I am the first to remind him that he finished with 5 silvers and 5 bronzes while the team and I finished with 2 golds 😏🇺🇸🇨🇦🥇

